import { useForm } from "react-hook-form";
import FormModel from "../FormModel/FormModel";
import InputModel from "../Input/Input";

interface FormProps {
  buttonText: string;
}

const FormRegister: React.FC<FormProps> = ({ buttonText }) => {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();

  const submitForm = (data: any) => {
    window.location.reload();
  };

  return (
    <>
      <FormModel onSubmit={submitForm} buttonText={buttonText}>
        <InputModel
          register={register}
          type="email"
          placeholder="Enter your email"
          error={errors.email && "Email is required"}
        />
        <InputModel
          register={register}
          type="email"
          placeholder="Enter your email"
          error={errors.email && "Email is required"}
        />
        <InputModel
          register={register}
          type="email"
          placeholder="Enter your email"
          error={errors.email && "Email is required"}
        />
      </FormModel>
    </>
  );
};

export default FormRegister;
